import React from "react";
// import MyTodoList from "./component/MyTodoList";

const App = () => {
  const style = {
    padding: "100px",
    display: "flex",
    gap: "12px",
  };

  const squareStyle = {
    width: "100px",
    height: "100px",
    border: "1px solid green",
    borderRadius: "10px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  };

  return (
    <div style={style}>
      <div style={squareStyle}>JS공부</div>
      <div style={squareStyle}>운동</div>
      <div style={squareStyle}>빨래</div>
      <div style={squareStyle}>산책</div>
      <div style={squareStyle}>청소</div>
    </div>
  );
};

export default App;
